    <script>
       function pageLoad() {
           var specialKeys = new Array();

           $("#trMontoFijo").hide();
            
        specialKeys.push(8); //Backspace
        $(function () {

            $(".txtNumericEP").bind("keypress", function (e) {
                var keyCode = e.which ? e.which : e.keyCode;
                var ret = ((keyCode >= 48 && keyCode <= 57) || specialKeys.indexOf(keyCode) != -1);
                return ret;
            });
            $(".txtNumericDP").bind("keypress", function (e) {
                var keyCode = e.which ? e.which : e.keyCode

                if (keyCode == '46' && $(this).val().indexOf(",") == -1) {
                    // IE
                    if (document.selection) {
                        var range = document.selection.createRange();
                        range.text = ',';
                        // Chrome + FF
                    } else if (this.selectionStart || this.selectionStart == '0') {
                        var start = this.selectionStart;
                        var end = this.selectionEnd;
                        $(this).val($(this).val().substring(0, start) + ','
                         + $(this).val().substring(end, $(this).val().length));
                        this.selectionStart = start + 1;
                        this.selectionEnd = start + 1;
                    } else {
                        $(this).val($(this).val() + ',');
                    }
                    return false;
                }

                var ret = ((keyCode >= 48 && keyCode <= 57) || specialKeys.indexOf(keyCode) != -1);
                var textValue = $(this).val();
                var ret = (ret || (keyCode == 44 && textValue.indexOf(",") == -1));

                return ret;
            });
            $(".txtNumericEP").bind("paste", function (e) {
                var clipbo;
                if (e.originalEvent.clipboardData) {
                    clipbo = e.originalEvent.clipboardData;
                } else {
                    clipbo = clipboardData;
                }

                if (parseInt(clipbo.getData("text")) > 0) {
                    if (clipbo.setData("text", String(parseInt(clipbo.getData("text"))))) {
                        return true;
                    } else {
                        return (String(parseInt(clipbo.getData("text"))) == clipbo.getData("text"))
                    }
                } else {
                    return false;
                }
            });
            $(".txtNumericDP").bind("paste", function (e) {
                var clipbo;
                if (e.originalEvent.clipboardData) {
                    clipbo = e.originalEvent.clipboardData;
                } else {
                    clipbo = clipboardData;
                }

                if (parseFloat(clipbo.getData("text").replace(',', '.')) > 0) {
                    if (clipbo.setData("text", String(parseFloat(clipbo.getData("text").replace(',', '.'))).replace('.', ','))) {
                        return true;
                    } else {
                        return (String(parseFloat(clipbo.getData("text").replace(',', '.'))) == clipbo.getData("text").replace(',', '.'))
                    }
                } else {
                    return false;
                }
            });
            $(".txtNumericDP").focusout(function () {
                if ($(this).val() != "") {
                    $(this).val(String(parseFloat($(this).val().replace(',', '.'))).replace('.', ','));
                }
            });
            $(".txtNumericEP,.txtNumericDP").bind("drop", function (e) {
                return false;
            });

            if (!Array.prototype.indexOf) {
                Array.prototype.indexOf = function (obj, start) {
                    for (var i = (start || 0), j = this.length; i < j; i++) {
                        if (this[i] === obj) { return i; }
                    }
                    return -1;
                }
            }

            $("#txtCodigoTroquel").bind("keypress", function (e) {
                var keyCode = e.which ? e.which : e.keyCode
                if (keyCode == 13) {
                    $("#imgLupaCodigoTroquel").click();
                    return false;
                }
            });
            $("#txtCodigoAlternativo").bind("keypress", function (e) {
                var keyCode = e.which ? e.which : e.keyCode
                if (keyCode == 13) {
                    $("#imgLupaCodigoAlternativo").click();
                    return false;
                }
            });
            $("#txtCantidad").bind("keypress", function (e) {
                var keyCode = e.which ? e.which : e.keyCode
                if (keyCode == 13) {
                    var inputs = $(this).closest('form').find(':input');
                    inputs.eq(inputs.index(this) + 1).focus();
                    return false;
                }
            });
            $("#txtPrecio").bind("keypress", function (e) {
                var keyCode = e.which ? e.which : e.keyCode
                if (keyCode == 13) {
                    var inputs = $(this).closest('form').find(':input');
                    inputs.eq(inputs.index(this) + 1).focus();
                    return false;
                }
            });
            $("#chbUsaMontoFijo").change(function () {
                if (!this.checked) {
                    //$("#ctl00_cphPrincipal_plMontoFijo").hide();
                    $("#txtMontoFijo").attr("disabled", "disabled");
                    $("#ctl00_cphPrincipal_ddlDescuento").removeAttr("disabled");
                }
                else {
                    //$("#ctl00_cphPrincipal_plMontoFijo").toggle();
                    $("#ctl00_cphPrincipal_ddlDescuento").attr("disabled", "disabled");
                    $("#txtMontoFijo").removeAttr("disabled");
                }
            });
            /*
            $("#ddlTipoDescuento").bind("keypress", function (e) {
            var keyCode = e.which ? e.which : e.keyCode  
            if(keyCode == 13){
            var inputs = $(this).closest('form').find(':input');  
