                }
            });

            /* era para el blanqueo y bloqueo pero no da
            $("#txtCodigoTroquel").change(function () {
                
            $("#txtCodigoAlternativo").val("");  
            $("#txtCodigoAlternativo")[0].disabled =true;
            setTimeout(function () {
            var text =  $("#txtCodigoTroquel").val();
            if(text == ""){
            $("#txtCodigoAlternativo")[0].disabled =false;
