    <script type="text/javascript">  
    
    function validarTroquel()
    {     
 
        var txtTroquel = document.getElementById("txtCodigoTroquel");   
        var validaOk = true; 

        valorCodBarra = txtTroquel.value; 
         
        if ((valorCodBarra.length > 7 && valorCodBarra.length < 13) || valorCodBarra.length <= 0) {
            validaOk = false;
            alert("La longitud del c√≥digo de medicamento ingresado no es v√°lida");
        }  
        return validaOk;
    }
 
    function InputCodigoTroquel(e)
    {
        var KeyID = (window.event) ? event.keyCode : e.which; //IE : FF 
        if (KeyID == 13) 
        { 
            e.returnValue = false;  
            document.getElementById("imgLupaCodigoTroquel").click();     
        } 
	    return true;
    }
 
    function InputCodigoAlternativo(e)
    {
        var KeyID = (window.event) ? event.keyCode : e.which; //IE : FF 
        if (KeyID == 13) 
        { 
            e.returnValue = false;  
            document.getElementById("imgLupaCodigoAlternativo").click();    
        }   
	    return true;
    }
    
    
